//
//
//       Hi, Welcome to you. You certainly need to learn more and that's 
//    good because I have something to tell you.
//       
//    You are looking at the code of Tykle. A software that should help 
//    us in our life. 
//
//    Tykle is not a WOT, it is not POW / POS either. It's a mix of things 
//    that allows me to do something essential.
//
//    With Tykle it is possible to verify a data without possessing all 
//    the blockchains but it is also possible to have the confidence of 
//    the existence of a data on network by processing the whole blockchain. 
//
//    If you want to actively join the Tykle network as a node or user 
//    then you will have to find a provider (with user invocation capability) 
//    that suits you and that will have to verify your identity otherwise 
//    you will be able to access the network for free. No personal data 
//    will be published, only your Tykle Circuit will be recognized. 
//    You can imagine that there are not many providers today so I created 
//    a provider while things are developing. https://www.signderiva.com/
//
//    A provider can be many things, but without entering into details it 
//    is also a member of a trust council (COT) that authorizes the arrival 
//    of new providers on the network. In general a provider is attached 
//    to a country in order to give it a legal existence on the network, 
//    its users (Tykle Circuit) are thus attached to this right. There 
//    is no real limit of nodes in the Tykle network however each node must 
//    have a real identity even if unknown to the public, the provider has 
//    this duty to control and checks can be done. It is also important to 
//    note that a provider cannot create an infinite number of nodes on its 
//    own and that only 10 nodes (can change) are activated by the network 
//    every hour when a new heartbeat is created.
//
//    I will detail all this a little later in an advanced white paper when 
//    I have more means to develop and protect it. This is also why we are 
//    here. I don't provide the coding details for the moment but I propose 
//    to test the thing in order to make an ICO to seriously finance this 
//    project.
//
//    And this is where I have to explain to you why you need to join the 
//    network quickly. The Tykle network provides cryptographic storage spaces 
//    where authentic public information can be stored without repudiation. 
//    These are called Tykle Surfaces. They are divided into lanes and cells. 
//    A surface is exactly 4GB and is made of 1 000 000 cells. The network must 
//    always have a free Tykle Surface that users can rent at any time. 
//    The creation of these missing cells is operated by the nodes, which place 
//    them in a pool of cells to be released the next hour. 
//
//    Each time your signature is required and you are present in the network 
//    you get a point which I call the debt point. In some cases it is made 
//    (during heartbeat - 26 pts, cot - 25 pts, provider - 25 pts) and in other 
//    cases it is recovered (via trust transactions for example). Every hour, 
//    debts are eliminated in the cell profile. Basically you will get cells 
//    instead of debts and if there are no cells then you keep your debt. 
//    This debt is transferable.
//
//    These spaces are expensive because they are currently replicated on all 
//    the nodes of the network. Depending on the size of the network it will 
//    be possible to shard and reduce the replication security, however this 
//    data will remain expensive.   
//
//    If I had to summarize what I use for all this: POA, Threshold Signature, 
//    Space Proof, Blockchain, Consensus Routing. I don't necessarily want to 
//    compare to one or the other, Tykle is something new that mixes a bit of 
//    everything to solve several fundamental technical problems that affect :
//
//    - The Atomic Clock (NTP)
//    - Domain names (DNS)
//    - IP addresses (v4/v6) or any other addressing mechanism (AS)
//    - Secure communication (TLS/SSL, S/Mime, GPG/PGP)
//
//    Big topic to come and a lot of fiduciary money to spend. After the raising 
//    I'll put all the code in open source (license still to be determined). For 
//    the moment disassembling is forbidden. 
//
//    Thanks for your understanding.
//
//             Michael VERGOZ <m.vergoz@signderiva.com>
//             https://twitter.com/mykiimike
//
//

